import React from 'react';
import './Header.css';

function Header() {
  return (
    <header className="header">
      <div className="logo">
        <h1>Yatra.com</h1>
      </div>
      <nav className="navbar">
        <ul className="nav-links">
          <li><a href="#home">Home</a></li>
          <li><a href="#contact">Contact Us</a></li>
          <li><a href="#login">Login/Signup</a></li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
